import { Component, OnInit } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { Plane } from 'src/app/Models/Plane/plane';
import { PlaneService } from 'src/app/Services/Plane/plane.service';

@Component({
  selector: 'app-delete-plane',
  templateUrl: './delete-plane.component.html',
  styleUrls: ['./delete-plane.component.css']
})
export class DeletePlaneComponent implements OnInit {

  planes: Plane

  constructor(private planeservice: PlaneService, private activatedRoute: ActivatedRoute) {
    this.planes = new Plane()
  }

  ngOnInit(): void {
    const id = this.activatedRoute.snapshot.paramMap.get('id')

    this.planeservice.getPlainById(id).subscribe(res => {
      this.planes = res
      console.log(res);
    })
  }

  deletePlane() {
    this.planeservice.deletePlane(this.planes).subscribe(res => {
      if (res) {
        console.log(res);
      }
    })
  }

}
